                            jQuery(".ms-acres").html(value.acres);
                            jQuery(".ms-price").html(value.price);
                            jQuery(".map-section-content").html(value.content);
                        }
                        else {
                            jQuery.LoadingOverlay("hide");
                            jQuery(".ms-title").html(value.title);
                            jQuery(".ms-acres").html(value.acres);
                            jQuery(".ms-price").html(value.price);
                            jQuery(".map-section-content").html(value.content);
                        }

                        jQuery("#tpopLOT").html(value.lot);
                        jQuery("#tpopLOTSize").html(value.acres);
                        jQuery("#tpopPrice").html(value.price);

                        if (value.availability_status) {
                            jQuery('.tpd-status-details > label').hide();
                            jQuery("#tpopPrice").html('SOLD');
                            jQuery("#tpopPrice").addClass('price-lg');

                        }
                        else {
                            jQuery('.tpd-status-details > label').show();
                            jQuery("#tpopPrice").removeClass('price-lg');
                        }

                        jQuery(that).magnificPopup({
                            items: {
                                src: '.tracker-popup',
                                type: 'inline'
                            },
                            fixedContentPos: true,
                            callbacks: {
                                beforeOpen: function () { jQuery('html').addClass('mfp-helper'); },
                                close: function () { jQuery('html').removeClass('mfp-helper'); }
                            }
                        }).magnificPopup('open');

                    });
            });

            jQuery('.path-action').darkTooltip({
                animation: 'fadeIn',
                theme: 'light',
                arrow: true,
            });


            jQuery(document).on('mouseenter', '#tiledMap svg path.path-action', function () {

                var this_id = jQuery(this).data('value');

                jQuery.each(cs_object.tracker_object, function (index, val) {

                    if (this_id == val.tracker_data_id) {

                        if (val.tracker_data_status) {
                            var zx = '<td colspan="2">SOLD</td>';

                            jQuery(document).find('.tip-lot').text(val.tracker_data_lot);
                            jQuery(document).find('.tip-price').text('SOLD');
                            jQuery(document).find('.tip-size').text(val.tracker_data_size);
                            jQuery(document).find('.tooltip-table').removeClass('available-prop');
                            jQuery(document).find('.tooltip-table').addClass('sold-prop');
                            return false;
                        }
                        else {
                            jQuery(document).find('.tip-lot').text(val.tracker_data_lot);
                            jQuery(document).find('.tip-price').text(val.tracker_data_price);
                            jQuery(document).find('.tip-size').text(val.tracker_data_size);
                            jQuery(document).find('.tooltip-table').removeClass('sold-prop');
                            jQuery(document).find('.tooltip-table').addClass('available-prop');
                            return false;
                        }
                    }
                    else {
                        jQuery(document).find('.tooltip-table').removeClass('sold-prop');
                        jQuery(document).find('.tip-lot').text('---');
                        jQuery(document).find('.tip-price').text('---');
                        jQuery(document).find('.tip-size').text('---');
                    }

                });

            });

        });
    </script>
</body>
